import React, { useState } from "react";

export default function AddUserTest() {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [role, setRole] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState(null);
  const [ok, setOk] = useState(null);

  function handleSubmit(e) {
    e.preventDefault();
    setError(null);
    setOk(null);

    const user = { username, email, role, password };
    fetch("http://localhost:9000/users", {
      method: "POST",
      headers: {
            'Content-Type': 'application/json',
            'x-access-token': "Available upon request",
             Authorization: `Bearer YOUR_TOKEN`
          },
      body: JSON.stringify(user)
    })
      .then(res => {
        if (!res.ok) throw new Error("API error: " + res.status);
        return res.json();
      })
      .then(data => setOk("User created: " + JSON.stringify(data)))
      .catch(e => setError(e.message));
  }

  return (
    <div style={{ maxWidth: 400, margin: "2em auto" }}>
      <h2>Add User Test</h2>
      <form onSubmit={handleSubmit}>
        <input
          style={{ display: "block", marginBottom: 10 }}
          value={username}
          onChange={e => setUsername(e.target.value)}
          placeholder="Username"
          required
        />
        <input
          style={{ display: "block", marginBottom: 10 }}
          value={email}
          onChange={e => setEmail(e.target.value)}
          placeholder="Email"
        />
        <input
          style={{ display: "block", marginBottom: 10 }}
          value={role}
          onChange={e => setRole(e.target.value)}
          placeholder="Role (e.g., USER)"
        />
        <input
          style={{ display: "block", marginBottom: 10 }}
          type="password"
          value={password}
          onChange={e => setPassword(e.target.value)}
          placeholder="Password"
        />
        <button type="submit">Create User</button>
      </form>
      {ok && <div style={{ color: "green", marginTop: 10 }}>{ok}</div>}
      {error && <div style={{ color: "red", marginTop: 10 }}>Error: {error}</div>}
    </div>
  );
}
